const INITAL_STATE = {
  name: '',
  assertions: '',
  score: '',
  gravatarEmail: '',
};

const reducer = (state = INITAL_STATE, action) => {
  switch (action.type) {
  case 'value':
    return state;
  default:
    return state;
  }
};

export default reducer;
